    console.log(data);


  useEffect(() => {
    axios
      .get("https://api.github.com/users/daideguchi/repos")
      .then((response) => setData(response));
  }, []);

  return (
    <div id="skills">
      <div className="container">
        <div className="heading">
          <h2>Skills</h2>
        </div>
        <div className="skills-container"></div>
      </div>
    </div>
  );
};
